import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To reveal the sort filter, we first need to perform a search.
    // Fill the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');

    // Click the search button
    // There are multiple search buttons, we'll click the first one associated with the main search bar.
    await page.locator('button.search-btn').first().click();

    // Wait for search results and the sort dropdown to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Locate the sort dropdown and select the 'Price: High to Low' option
    const sortDropdown = page.locator('#sortSelect');
    await sortDropdown.selectOption({ value: 'price-high' });

    // Take a screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_sorted_by_price.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_sorted_by_price.png'));

    // Extract the current value of the sort dropdown to verify the action
    const selectedSortValue = await sortDropdown.inputValue();

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter.",
      extractedData: {
        selectedSortOption: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, return a failure object
    const errorScreenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
      console.error('Failed to take error screenshot:', e);
    }

    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
